import logo from './logo.svg';
import './App.css';
import Jopa from './components/Header';

function App() {
  return (
    <div className="app-wrapper">

      <Jopa /> 

      <nav className="navbar">
        <div>
          <a href="">Messages</a>
        </div>
        <div>
          <a href="">News</a>
        </div>
        <a href="">Music</a>
        <div>
          <a href="">Settings</a>
        </div>
      </nav>

      <div className="content">
        текст
      </div>
    </div>
  );
}

export default App;
